import { Card } from 'react-bootstrap';
function ContactMe() {
    return (
        <>
            <Card className="text-center mx-5">
                <Card.Body>
                    <Card.Title>Contact Me</Card.Title>
                    <Card.Text>
                    You can reach me at:
                    <br />
                    Email:
                    <a href="mailto:ahmad@example.com">ahmad@example.com</a>
                    <br />
                    Phone: +123 456 7890
                    </Card.Text>
                </Card.Body>
            </Card>
        </>
    );
}
export default ContactMe;
